import { BrowserRouter, Routes, Route } from "react-router-dom";
import App from "./App";
import React from 'react';

const RouteSwitch = () => {
  return (
    <BrowserRouter>
    <NavBar/>
      <Routes>
        <Route path="/waldo" element={<App />} />
        <Route path="/level" element={<Level />} />
      </Routes>
    </BrowserRouter>
  );
};

export default RouteSwitch;
